ries-de-herois-da-dc-com-antecedencia','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/netflix-assina-acordo-para-receber-series-de-herois-da-dc-com-antecedencia/59997','','2016-07-06 08:41:15',5),(30857,'Imagens vazadas de suposto iPhone 7 mostram câmera maior','','O site holandês TechTastic.nl obteve algumas imagens vazadas do suposto iPhone 7, o próximo modelo de iPhone a ser lançado pela Apple. As imagens obtidas pelo site revelam poucas diferenças com relação aos modelos anteriores - mas alguns detalhes bem interessantes.\nUma das primeiras coisas que chamam a atenção nas imagens é a lente da câmera na traseira do dispositivo, que é considerave...',NULL,'imagens-vazadas-de-suposto-iphone-7-mostram-camera-maior','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/imagens-vazadas-de-suposto-iphone-7-mostram-camera-maior/59996','','2016-07-06 08:41:15',5),(30858,'Juiz de Minas Gerais usa o WhatsApp para intimar réus','','Diante da dificuldade em localizar duas pessoas envolvidas em um processo, o juiz de direito Luiz Olympio Brandao Vidal, da Vara do Trabalho de Três Corações, em Minas Gerais, acolheu o requerimento de advogados para que as partes fossem intimadas pelo WhatsApp.\nAs pessoas teriam declarado seus endereços, mas não teriam sido encontradas no momento de entrega da intimação.\nA defesa explica q...',NULL,'juiz-de-minas-gerais-usa-o-whatsapp-para-intimar-reus','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/juiz-de-minas-gerais-usa-o-whatsapp-para-intimar-reus/59995','','2016-07-06 08:41:15',5),(30859,'Hackers ganham quase R$ 1 milhão por mês com vírus para Android','','O instituto de pesquisa em segurança Check Point revelou nesta terça-feira, 5, uma análise completa de um perigoso vírus para Android que já atingiu mais de 85 milhões de dispositivos em todo o mundo. Só com propagandas em aplicativos maliciosos, os criadores do malware ganham mais de US$ 300 mil por mês - equivalente a quase R$ 1 milhão em conversão direta.\nO vírus se chama HummingBad ...',NULL,'hackers-ganham-quase-r-1-milhao-por-mes-com-virus-para-android','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/hackers-ganham-mais-de-us-300-mil-por-mes-com-virus-para-android/59994','','2016-07-06 08:41:15',5),(30860,'Nintendo quer ter certeza que a realidade virtual é segura para crianças','','Grande parte das empresas de tecnologia está investindo na realidade virtual, apontada como uma das grandes tendências para o futuro. A Nintendo é uma dessas companhias, mas, de acordo com o desenvolvedor Shigeru Miyamoto, há uma preocupação no desenvolvimento dessa tecnologia: torná-la segura para as crianças.\n\"Nossos produtos atuais são feitos para serem jogados por um período relativa...',NULL,'nintendo-quer-ter-certeza-que-a-realidade-virtual-e-segura-para-criancas','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/nintendo-quer-ter-certeza-que-a-realidade-virtual-e-segura-para-criancas/59993','','2016-07-06 08:41:15',5),(30861,'Para tristeza dos adolescentes, adultos estão usando mais o Snapchat','','Há três anos, o aplicativo Snapchat era basicamente uma plataforma composta por adolescentes. Somente 5% dos usuários tinham entre 25 e 34 anos e 2% tinham mais que 35 anos.\nPorém, esses números mudaram: uma pesquisa da comScore revela que, atualmente, 38% dos usuários do app de mensagens estão acima dos 25 anos e 14% já completaram 35 anos. Além disso, 70% das pessoas que tem um smartpho...',NULL,'para-tristeza-dos-adolescentes-adultos-estao-usando-mais-o-snapchat','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/para-tristeza-dos-adolescentes-adultos-estao-usando-mais-o-snapchat/59990','','2016-07-06 08:41:15',5),(30862,'Chatbot da Microsoft mescla rosto de famosos em segundos','','A Microsoft lançou um novo chatbot que permite misturar rostos de pessoas em uma só imagem. A novidade, desenvolvida para mostrar a capacidade dos sistemas de inteligência artificial da emp