computador para disputar mercado com o iMac, da Apple. Os rumores são de um dispositivo “all-in-on” (AIO) com Windows 10 com tela sensível ao toque.\nEntre as evidencias do suposto projetos estão um pedido de patente de um desktop que se encaixa nas descrições do futuro computador, além de o desenvolvedor de apps e softwares Shubhan Ch...',NULL,'rumor-microsoft-prepara-um-rival-a-altura-do-imac','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/rumor-microsoft-prepara-um-rival-a-altura-do-imac/59988','','2016-07-06 08:41:15',5),(30866,'Falha em computadores Lenovo permite driblar proteções do Windows','','A Lenovo reconheceu uma falha em seus laptops ThinkPad, que oferecem uma brecha grave para o cibercrime. O ataque pode desabilitar a proteção contra gravação de dados no firmware UEFI por meio de um driver, o que abre uma vulnerabilidade gigante para que alguém com más intenções ganhe privilégios indevidos sobre um computador.\nEm nota divulgada pela Lenovo, a empresa se exime de culpa, in...',NULL,'falha-em-computadores-lenovo-permite-driblar-protecoes-do-windows','http://olhardigital.uol.com.br/checar.php?materia=/pro/noticia/falha-de-seguranca-afeta-computadores-lenovo/59984','','2016-07-06 08:41:15',5),(30867,'Pare de caluniar a química','','Por Fábio Marton Em 1984, uma indústria química na cidade de Bhopal, Índia, liberou 30 toneladas de isocianato de metila no ar. O composto causa queimaduras químicas nos olhos, pele e tecidos internos do pulmão. Em 24 horas, até 25 mil pessoas morreriam. A maioria delas moradoras de uma favela próxima. Foi o pior desastre industrial […]',NULL,'pare-de-caluniar-a-quimica','http://super.abril.com.br/blogs/superblog/pare-de-caluniar-a-quimica/','','2016-07-06 08:41:15',3),(30868,'#ChegaDeSilêncio – 104 histórias de leitores que sofreram abuso sexual e/ou estupro','','A reportagem de capa da SUPER deste mês trata de um assunto espinhoso e pouco discutido: estupro. No dia primeiro de julho, publicamos em nossa pági